  static List<CountryOptions> listFromJson(dynamic json, {bool growable = false,}) {
    final result = <CountryOptions>[];
    if (json is List && json.isNotEmpty) {
      for (final row in json) {
        final value = CountryOptions.fromJson(row);
        if (value != null) {
          result.add(value);
        }
      }
    }
    return result.toList(growable: growable);
  }

  static Map<String, CountryOptions> mapFromJson(dynamic json) {
    final map = <String, CountryOptions>{};
    if (json is Map && json.isNotEmpty) {
      json = json.cast<String, dynamic>(); // ignore: parameter_assignments
      for (final entry in json.entries) {
        final value = CountryOptions.fromJson(entry.value);
        if (value != null) {
          map[entry.key] = value;
        }
      }
    }
    return map;
  }

